function App() {
  return (

    <div className="app">

      <h1>What's app</h1>
      {/* <SignUp className="signup_box"/> */}

      <div className="app_body"> 
        <Sidebar user="nk"/>
        <Chat user="nk"/>
      </div>
    </div>
  );
}

export default App;
